import React, { Component } from 'react';
import Header from './components/header/header';
import About from './components/about/about';
import Footer from './components/footer/footer';
class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <About />
        <Footer />
      </div>
    );
  }
}export default App;
